import React from 'react';
import styled from 'styled-components';
import { FaHamburger, FaCartPlus } from 'react-icons/fa';

export default function Navbar() {
	return (
		<NavWrapper>
			<FaHamburger className='nav-icon' />
			<div className='nav-bran'>TechBuddy</div>
			<FaCartPlus className='nav-icon' />
		</NavWrapper>
	);
}

const NavWrapper = styled.nav`
	width: 100%;
	margin: 0;
	background: transparent;
	padding: 2rem;
	color: #fff;
	font-size: 2rem;
	font-family: 'Poppins';
	display: flex;
	align-items: center;
	.nav-bran {
		margin: 0 auto;
		text-shadow: 0px 4px 4px rgba(0, 0, 0, 1);
	}
	.nav-icon {
		font-size: 2.2rem;
		color: #ca3433;
	}
`;
